import '../Busca/Busca.css'

const Busca = ({}) => {
    const [Busca,setBusca]=useState('')
    return(
        <div className='titulo'>
            <span>Busca: </span>
            <input 
            type='search'
            value ={Busca} 
            onChange={(el)=> setBusca(el.target.value)  }
            />
        </div>
    )
}
export default Busca
